import './App.css';
import Lists from './Components/Lists';

function Header(props) {
    return (
      <div>
        <h1>Full Stack Development Roadmap- {props.year}</h1>
      </div>
    )
}


function App() {
  return (
    <div className="App">
      <Header year="2022" />
    </div>
  );
}

export default App;
